import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Button, StyleSheet, Text, View,TouchableOpacity } from 'react-native';
import { createAppContainer } from 'react-navigation';
import { createStackNavigator } from 'react-navigation-stack';

export default class Slot extends React.Component {

    Slot1 = () => {
        console.log('This is Slot 1 ');
    }
    Slot2 = () => {
        console.log('This is Slot 2 ');
    }
    Slot3 = () => {
        console.log('This is Slot 3 ');
    }
    Slot4 = () => {
        console.log('This is Slot 4 ');
    }
    Slot5 = () => {
        console.log('This is Slot 5 ');
    }
    Slot6 = () => {
        console.log('This is Slot 6 ');
    }
    Slot7 = () => {
        console.log('This is Slot 7 ');
    }
    Slot8 = () => {
        console.log('This is Slot 8 ');
    }
    Slot9 = () => {
        console.log('This is Slot 9 ');
    }
    Slot10 = () => {
        console.log('This is Slot 10 ');
    }

    constructor(props) {
        super(props);
        this.buttonPress = this.buttonPress.bind(this);
    }

    buttonPress() {
        console.log('called');
        this.props.navigation.navigate('pay');
    }
    render() {
        const buttonStyle = {
            color: "#008484",
            backgroundColor: "#FFFFFF",
            padding: "22px",
            paddingTop: "10px",
            fontFamily: "calibri",
            fontSize: "30px",
            marginRight: "80px",
            height: "60px",
            width: "160px",
            borderWidth: 6,
            borderColor: "#FFFFFF"
        }
        const buttonStyleten = {
            color: "#008484",
            backgroundColor: "#FFFFFF",
            padding: "17px",
            paddingTop: "10px",
            paddingRight: "18px",
            paddingLeft: "18px",
            fontFamily: "calibri",
            fontSize: "30px",
            marginRight: "80px",
            height: "60px",
            width: "160px",
            borderWidth: 6,
            borderColor: "#FFFFFF"
        }
        const buttonStyleentry = {
            color: "#008484",
            backgroundColor: "#FFFFFF",
            padding: "17px",
            paddingTop: "10px",
            paddingRight: "18px",
            paddingLeft: "18px",
            fontFamily: "calibri",
            fontSize: "25px",
            marginRight: "80px",
            height: "60px",
            width: "200px"
        }
        const buttonStyleGo = {
            color: "#FFFFFF",
            backgroundColor: "#008484",
            paddingBottom: "17px",
            paddingTop: "3px",
            paddingRight: "18px",
            paddingLeft: "18px",
            fontFamily: "calibri",
            fontSize: "35px",
            marginRight: "80px",
            height: "60px",
            width: "150px",
            borderWidth: 6,
            borderColor: "#FFFFFF",
        }
        const selectText = {
            color: "#FFFFFF",
            fontFamily: "calibri",
            justifyContent: 'center',
            fontSize: "40px",
            marginRight: 65
        }
        return (
            <View style={styles.container}>
                <View style={styles.rowContainer}>
                    <Text style={selectText}>Select Your Slot</Text>
                </View>
                <View style={styles.rowContainer}>
                    <button style={buttonStyle} onClick={this.Slot1}>Slot 1</button>
                    <button style={buttonStyle} onClick={this.Slot2}>Slot 2</button>
                </View>
                {/* disabled="true" */}
                <View style={styles.rowContainer}>
                    <button style={buttonStyle} onClick={this.Slot3}>Slot 3</button>
                    <button style={buttonStyle} onClick={this.Slot4}>Slot 4</button>
                </View>
                <View style={styles.rowContainer}>
                    <button style={buttonStyle} onClick={this.Slot5}>Slot 5</button>
                    <button style={buttonStyle} onClick={this.Slot6}>Slot 6</button>
                </View>
                <View style={styles.rowContainer}>
                    <button style={buttonStyle} onClick={this.Slot7}>Slot 7</button>
                    <button style={buttonStyle} onClick={this.Slot8}>Slot 8</button>
                </View>
                <View style={styles.rowContainer}>
                    <button style={buttonStyle} onClick={this.Slot9}>Slot 9</button>
                    <button style={buttonStyleten} onClick={this.Slot10} >Slot 10</button>
                </View>
                <View style={styles.rowContainer}>
                    <button style={buttonStyleentry} disabled="true">Entry Gate</button>
                </View>
                {/* <View style={styles.rowContainer}>
                    <button style={buttonStyleGo} onClick={()=>this.navigation.navigate('pay')}>GO</button>
                </View> */}
                <View style={styles.rowContainer}>
                    <button style={buttonStyleGo} onClick={this.buttonPress}>GO</button>
                </View>
                <StatusBar style="auto" />
            </View>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#008484',
        alignItems: 'center',
        justifyContent: 'center'
    },
    rowContainer: {
        margin: 10,
        flex: 1,
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'center',
        marginBottom: '2px'
    }

});
